(18, '999112', 'Rodrigo Mauricio', 'García', '23', '10/07/1996', 'Geográfica', 'Cuarto', 'Masculino', 'Acrofobia', 'Trauma infantil.', 'Resequedad en la boca.', 'SESIÓN 1: Se observa que el paciente se encuentra estable en los primeros minutos de la simulación.\r\n\r\n\r\nSESIÓN 2: No se observo nada en especial.', NULL, ),
(19, '999999666665', 'Alejandro', 'Gómez Cari', '20', '01/01/20000', 'Electrónica', 'Quinto', 'Masculino', 'Claustrofobia', 'Se quedó encerrado cuando era niño por mucho tiempo.', 'Palpitaciones aceleradas.DDDD', 'SESIÓN 1: Se observa que el paciente tiene una frecuencia cardiaca estable y su temperatura de la piel no presenta grandes alteraciones. \r\n\r\nSESIÓN 2: No se tienen observaciones pertinentes.', '21/Jul/2020', );
