INSERT INTO `tclientes` (`IdCliente`, `CI`, `Nombre`, `Apellido`, `Edad`, `FechaNac`, `Carrera`, `Semestre`, `Genero`, `Fobia`, `Antecedentes`, `Sintomas`, `Observaciones`, `Fecha`, `Imagen`) VALUES
(22, '678904332', 'Carlos David', 'Montero López', '20', '20/08/2001', 'Ing Comercial', 'Tercero', 'Masculino', 'Claustrofobia', 'Se quedó encerrado en una habitación por dos días por descuido cuando era niño.', 'Palpitaciones aceleradas.', 'SESION 1: Se observa una frecuencia estable a lo largo de los escenarios 1 y 2. La frecuencia varía entre 60 y 90 lo cual es normal. El nivel de miedo es \"relajación total\". Tal parece que el paciente logra superar la prueba sin complicaciones. El paciente logró llegar al último nivel. Se desplaza sin problemas. El nivel de miedo aun es de \"relajación total\". La frecuencia cardiaca sigue estable al igual que la temperatura. El paciente logró completar todos los niveles con éxito.', '25/Aug/2020', );
