(32, '6996225', 'Valeria', 'Murilllo', '18', '03/10/2001', 'Prefacultativos de Ingeniería', 'Prefacultativos', 'Femenino', 'Acrofobia', 'Tuvo mucho miedo cuando se acercó al balcón del edificio de uno de sus amigos.', 'Sensación de pánico.', '71 fc aumenta en el tercer nivel  a 94, en el cuarto nivel disminuye.\r\n\r\n 29.5 temp aumenta levemente en el segundo y mayor aumento en el tercer nivel, en el cuarto disminuye como en el segundo nivel.', '20/Sep/2020', ),
(33, '3377104', 'Paola', 'Murillo Nogales', '45', '26/05/1972', 'Turismo', 'Egresado', 'Femenino', 'Claustrofobia', 'Al subir las gradasestrechas  en la oscuridad hacia su departamento, sintio cierto temor por la oscuridad.', 'Acelerar el paso cuando siente que esta en un lugar cerrado y oscuro por el temor que le genera.', 'fc inicial es 71\r\ntp inicial es 27.13\r\n\r\nsu fc baja y la tp aumenta levemente, en el 2do nivel, al en el 3er nivel su fc aumenta a 88 y baja abruptamente a 61, su temperatura esta ligeramente aumentata.', '20/Sep/2020', ),
